func Test_calcGCD(t *testing.T) {
	tests := []struct {
		name string
		a    int
		b    int
		want int
	}{
		{
			name: "1",
			a:    60,
			b:    12,
			want: 12,
		},
		{
			name: "2",
			a:    1997,
			b:    2020,
			want: 1,
		},
		{
			name: "2",
			a:    1997,
			b:    1997,
			want: 1997,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := calcGCD(tt.a, tt.b); got != tt.want {
				t.Errorf("calcGCD() = %v, want %v", got, tt.want)
			}
		})
	}
}

